import React from 'react';
import { Link } from 'react-router-dom';

const ForgotPassword = () => {
  return (
    <div>
      <h2>Forgot Password</h2>
      <p>This feature is not implemented yet.</p>
      <Link to="/">Back to Login</Link>
    </div>
  );
};

export default ForgotPassword;
